        double modelBiases2 = 3.080520153045654297e+00;
        for (int hit=0; hit<EpdHits->GetEntries(); hit++)
        {
            StPicoEpdHit* epdHit = (StPicoEpdHit*)((*EpdHits)[hit]);
            double nMIPvalue = epdHit->nMIP();
            int ew = (epdHit->id()<0)?0:1;
            int pp = epdHit->position();
            int tt = epdHit->tile();

            if (ew == -1)
            {
                ew = 0;
            }

            for (int k = 0; k < 32; k+=2)
            {
                if ((tt >= k) && (tt < k+2))
                {
                    int g = (tt - tt % 2)/2 + 1 + ew*16;
                    nMIP[g] += nMIPvalue;
                }
            }   
        }

        double EPDref = 0;
        double intermediate0[64] = {0,0,0,0};
        double intermediate1[32] = {0,0};
        for (int i = 0; i < 64; ++i)
        {
            for (int j = 0; j < 33; ++j)
            {
                intermediate0[i] += modelWeights0[j][i]*nMIP[j];
            }
            intermediate0[i] += modelBiases0[i];
            if (intermediate0[i] < 0.0)
            {
                intermediate0[i] = 0.0;
            }
        }
        for (int i = 0; i < 32; ++i)
        {
            for (int j = 0; j < 64; ++j)
            {
                intermediate1[i] += modelWeights1[j][i]*intermediate0[j];
            }
            intermediate1[i] += modelBiases1[i];
            if (intermediate1[i] < 0.0)
            {
                intermediate1[i] = 0.0;
            }
        }
        for (int i = 0; i < 32; ++i)
        {
            EPDref += modelWeights2[i][0]*intermediate1[i];
        }
